import './Menu.css'
import React from "react";
import Button from "../MenuButton/MenuButton"
import { useTranslation } from 'react-i18next';

const Menu = () => {
    const [translation] = useTranslation();
    return(
        <div className="menu">
            {
                localStorage.getItem("Token") ?
                <div className="content">
                <ul className="navbar">
                    { translation('menu', { returnObjects: true }).map((data) =>
                        <li className= "navbar__item" key = {data.id}>
                            <div className={"navbar__item--icon " + data.icon}></div>
                            <Button
                                data = {data} 
                                key = {data.id}
                            />
                        </li>
                    )}
                </ul>                
                <div className="content__copytight">
                    © И. А. Бабайлов, 2024
                </div>
            </div>
                :
                <div className="container">
                    <div className="header__content">
                        <div className="header__content--logo"></div>
                        <div className="header__content--text">
                            Corp
                        </div>
                    </div>
                </div>
            }
            
        </div>
    );
}
export default Menu;
